import Events from '../components/main/events';
import Post from '../components/layout/post';
import Title from '../components/main/title';

const Ale = () => {

  return(
    <div className="main">
      <Title word="La mas hermosa" />
      <div className="cont">
        <div className="image">

        </div>
        <div className="info">
        </div>
      </div>
      <style jsx>{`

      `}
      </style>
    </div>
  )
}

const Main = () => {
  const postVisible = useSelector(state => state.post.visible);
  return(
    <Layout>
      <Hero />
      <Embajada />
      <Events />
      <Ale />
      <GreenPost />
      { postVisible && <Post /> }
    </Layout>
  )
}

export default Main;
